import React from 'react';
import Navigation from './Navigation'; // Import Navigation

const Home = () => {
    return (
        <main>
         <section className="glass">

          <Navigation />
          <div className="content">
           <div className="card">
            <div className="card-title-bar">Home</div> 
             <div className="content-title"> 
              <h1>Home</h1>
             </div>
            </div>
          </div>
         </section>
        </main>
    );
};

export default Home;
